CREATE TABLE event (
	id INTEGER NOT NULL, 
	title VARCHAR(255) NOT NULL, 
	description TEXT, 
	location VARCHAR(255) NOT NULL, 
	start_time TIMESTAMP NOT NULL, 
	end_time TIMESTAMP NOT NULL, 
	author_id INTEGER, 
	is_published BOOLEAN NOT NULL, 
	like_count INTEGER, 
	image BLOB, 
	PRIMARY KEY (id), 
	FOREIGN KEY(author_id) REFERENCES user (id)
);
